var yeah = 'data:image/png;base64,';

var osmSource = new ol.source.OSM();
var _layers = [];

/********* Config Source Map *********/
osmSource.setTileLoadFunction(function(image, link) {
    console.log(link)

    if (localStorage.imageBase64) {

        image.Y().src = localStorage.imageBase64;
    } else {

        image.Y().src = link;
    }




    //window.postMessage(link);
});



var layer = new ol.layer.Tile({
    source: osmSource
  });

_layers.push(layer);

var map = new ol.Map({
    layers: _layers,
    target: 'map',
    controls: ol.control.defaults({
      attributionOptions: /** @type {olx.control.AttributionOptions} */ ({
        collapsible: false
      })
    }),
    view: new ol.View({
      center: ol.proj.transform(
          [-0.1275, 51.507222], 'EPSG:4326', 'EPSG:3857'),
      zoom: 10
    })
});

// *********** ADD POINTS ***********

if (typeof(Storage) !== "undefined") {
    console.log('LocalStorage');
} else {
    console.log('Do not support LocalStorage');
}



//*********** REGISTER EVENTS ***********
let dataPassed = document.getElementById("data-passed");


document.addEventListener("message", function(event) {
    console.log("Received post message", event);

    localStorage.setItem('imageBase64', event.data);
    map.refresh();
    zoom();
}, false);

function zoom() {
    map.getView().setZoom(12);
}

